import React from "react";
import { StyledBackgroundImagePreview } from "./Styled";
import { StyledLabel } from "../../../UI/Input";
import { FlexColumn } from "../../../UI/FlexColumn";

export const BackgroundImagePreview: React.FC<{ imageUrl: string }> = ({
  imageUrl
}) => {
  return (
    <FlexColumn>
      <StyledLabel>Background image (click to change)</StyledLabel>
      <StyledBackgroundImagePreview src={imageUrl} />
    </FlexColumn>
  );
};
